import React from 'react';
import './App.css';
import Navbar from './components/Navbar';



function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="logo-container">
          <img src="logo.png" alt="Logo" className="logo" />
          <h1>Your SE</h1>
        </div>
        <div className="search-container">
          <input
            type="text"
            className="search-input"
            placeholder="Search on your SE..."
          />
        </div>
        <p className="description">
          Welcome to your SE, the free, open-source and non-profit search engine.
          You can start searching by using the search bar above!
        </p>
        <div className="buttons-container">
          <button className="action-button">Google Drive</button>
          <button className="action-button">My Docs</button>
        </div>
      </header>
    </div>
  );
  return (
    <div className="App">
      <Navbar />
      <div className="content">
        <SearchBar onSearch={handleSearch} />
        {results && (
          <div className="results">
            <h2>Résultat généré :</h2>
            <p>{results.generated_response}</p>
            <h3>Documents associés :</h3>
            <ul>
              {results.retrieved_documents.map((doc, index) => (
                <li key={index}>{doc}</li>
              ))}
            </ul>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
